const colorLUT = new Map<
  string,
  { hexIndex: string; red: number; green: number; blue: number }
>();
PALETTES[0].map((color, index) =>
  colorLUT.set(color, {
    hexIndex: index.toString(16),
    red: parseInt(color.substr(1, 2), 16),
    green: parseInt(color.substr(3, 2), 16),
    blue: parseInt(color.substr(5, 2), 16)
  })
);

const findClosestColor = (red: number, green: number, blue: number) => {
  let min = 1000000000;
  let val = '';

  // minimize difference
  colorLUT.forEach((v, k) => {
    const distance = Math.sqrt(
      Math.pow(v.red - red, 2) +
        Math.pow(v.green - green, 2) +
        Math.pow(v.blue - blue, 2)
    );

    if (distance < min) {
      min = distance;
      val = v.hexIndex;
    }
  });

  return val;
};

export const decodePencil = async (data: string): Promise<string> => {
  const coinBuffer = await sharp(Buffer.from(data, 'base64')).resize(800, 800);

  let decoded = Array(23).fill('');

  await Promise.all(
    await pixels.map(async (pixel, index) => {
      const croppedBuffer = await coinBuffer
        .clone()
        .extract({ left: pixel.left, top: pixel.top, width: 28, height: 28 })
        .png()
        .toBuffer();

      const pixelStats = await sharp(croppedBuffer).stats();

      const red = Math.round(pixelStats.channels[0].mean);
      const green = Math.round(pixelStats.channels[1].mean);
      const blue = Math.round(pixelStats.channels[2].mean);

      decoded[index] = findClosestColor(red, green, blue);
    })
  );

  let decodedString = '';
  decoded.map((v) => (decodedString += v));

  return decodedString;
};

export const getTokenIDForCoin = async (
  coinB64: string
): Promise<{
  tokenId: number | undefined;
  coinCreator: string | undefined;
  claimer: string | undefined;
}> => {
  // TODO: lookup x_y from db, for now this is done in memory
  const decoded = await decodePencil(coinB64);

  let result = await prisma.generatedCoin.findFirst({
    where: {
      digest: decoded
    }
  });

  if (result) {
    // if there was a result for this coin, make sure that
    // there are no gorblin coins for the tile

    const gorblin = await prisma.gorblinCoin.findFirst({
      where: {
        x: result.x,
        y: result.y
      }
    });

    // if a gorblin for this x,y exists say this is an invalid coin
    if (gorblin) {
      return {
        tokenId: undefined,
        coinCreator: undefined,
        claimer: undefined
      };
    }
  }

  // lookup gorblin coin
  if (result == undefined) {
    const gorblinResult = await prisma.gorblinCoin.findFirst({
      where: {
        digest: decoded
      }
    });

    if (gorblinResult) {
      return {
        tokenId: gorblinResult.tokenID,
        coinCreator: gorblinResult.creator,
        claimer: gorblinResult.claimer
      };
    }
  }

  return {
    tokenId: result?.tokenID,
    coinCreator: result?.creator,
    claimer: undefined
  };
};

export const checkTokenIdIsOwnedByLandGranter = async (
  tokenId: number
): Promise<boolean> => {
  try {
    const contract = getContract(getJsonRpcProvider);
    const ownerAddress = await contract.ownerOf(tokenId);

    return (
      ownerAddress.toLowerCase() === LAND_GRANTER_CONTRACT_ADDRESS.toLowerCase()
    );
  } catch (err) {
    console.log(err);
    return false;
  }
};

export const grantLandTile = async (
  tokenId: number,
  recipient: string,
  coinCreator: string
): Promise<ContractTransaction> => {
  const wallet = new Wallet(
    process.env.CONTRACT_OWNER_PRIVATE_KEY as string,
    getJsonRpcProvider
  );
  const contract = LandGranter__factory.connect(
    LAND_GRANTER_CONTRACT_ADDRESS,
    wallet
  );

  const nonce = await wallet.getTransactionCount();
  // const gasPrice = utils.parseUnits('70', 'gwei');

  return contract.grant(tokenId, recipient, coinCreator, {
    // gasPrice,
    nonce
  });
};

export const encodePencil = async (
  x: number,
  y: number,
  addr: string,
  gorblin: boolean = false,
  claimer: string = ''
) => {
  const parsedPencilSVG = await parse(pencilSVG);
  console.log(parsedPencilSVG.children.length);

  const data = crypto
    .createHash('sha256')
    .update(
      `${
        gorblin ? process.env.GORBLIN_SALT : process.env.LAND_GRANTER_SALT
      }${x}${y}${addr.slice(2)}${claimer}`
    )
    .digest('hex')
    .slice(0, 23);

  parsedPencilSVG.children.map((rect: any, index: number) => {
    const colorIndex = parseInt(data[index], 16);
    rect.attributes.fill = PALETTES[0][colorIndex];
  });

  return { svg: stringify(parsedPencilSVG), digest: data };
};

// Should only be called by admin
export const generateCoin = async (
  tokenId: number,
  address: string,
  isGorblin: boolean = false,
  claimer: string = ''
): Promise<{ coin: Buffer; digest: string }> => {
  const [x, y] = getCoordinates(tokenId);

  // TODO change to gorblin coin if isGorblin is true
  const baseCoinBuffer = Buffer.from(
    isGorblin ? baseGorblinCoinB64String : baseCoinB64String,
    'base64'
  );
  const { svg: encodedPencil, digest } = await encodePencil(
    x,
    y,
    address,
    isGorblin,
    claimer
  );
  const coinBuffer = await sharp(baseCoinBuffer)
    .composite([
      {
        input: Buffer.from(encodedPencil),
        top: 213,
        left: 298
      },
      {
        input: Buffer.from(
          `<svg width="800" height="800" viewBox="0 0 800 800" fill="none" xmlns="http://www.w3.org/2000/svg"><style type="text/css">@font-face { font-family: VT323; src: './VT323-Regular.ttf'; }</style><text fill="${
            isGorblin ? '#003A2E' : '#E68D3E'
          }" xml:space="preserve" style="white-space: pre" font-family="VT323" font-size="72" letter-spacing="0em" x="50%" y="64%" dominant-baseline="middle" text-anchor="middle">[${x},${y}]</text></svg>`
        )
      }
    ])
    .png()
    .toBuffer();

  return { coin: coinBuffer, digest };
};

